import { Component } from '@angular/core';
import { NgbDropdownConfig, NgbDropdownModule,NgbNavConfig,NgbNavModule } from '@ng-bootstrap/ng-bootstrap';
import { faHome } from '@fortawesome/free-solid-svg-icons';


@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
@Component({
	selector: 'ngbd-dropdown-config',
	standalone: true,
	imports: [NgbDropdownModule],
	templateUrl: './app.component.html',
	providers: [NgbDropdownConfig], // add NgbDropdownConfig to the component providers
})

@Component({
	selector: 'ngbd-nav-config',
	standalone: true,
	imports: [NgbNavModule],
	templateUrl: './app.component.html',
	providers: [NgbNavConfig], // add NgbNavConfig to the component providers
})
export class AppComponent {
  title = 'Front-Angular';
  faHome=faHome;

}
export class NgbdDropdownConfig {
	constructor(config: NgbDropdownConfig) {
		// customize default values of dropdowns used by this component tree
		config.placement = 'top-start';
		config.autoClose = false;
	}
}

export class NgbdNavConfig {
	constructor(config: NgbNavConfig) {
		// customize default values of navs used by this component tree
		config.destroyOnHide = false;
		config.roles = false;
	}
}
